const Graph = ({node}) => {
    if (node) {
        return (
            <div>
                <p>{node.identity}</p>
                <p>{node.labels}</p>
                <p>{node.properties.name}</p>
                <p>{node.properties.neo4jImportId}</p>
            </div>
        )

    } else {
        return (<div></div>)
    }


}

export default Graph
